const Course = ({ course}) => {
    const total = course.reduce(
        (a, b) => a + b.parts.exercises,
        0
    );
  
return (
    <div>
            {course.map(index =>
        <ul key={index.id}>
            {console.log(index.id)}
        {index.name}
         </ul>
            )} 
          {course.map(index =>
          <ul key={index.parts}>
              {console.log(index.exercises)}
              {index.exercises}
              {index.map(x =>
              <ul key={x.id}>
                  {console.log(x.name)}
                </ul>
                )}
          </ul>
            )}  
            total of {total} exercises
           
    </div>
)
}

export default Course
